        -new batch arrived today, cells were getting empty, so we really needed the fresh meat. command has told us to try and reduce fatal accidents in the future, but i think they dont *really* care as long as production keeps up, just gotta say it for the records


        -another one got torn apart by ore crabs, the rest refused to go back in afterward and an riot started. damn officers have no self control, beat three near to death. gonna need to add an order of medical supplies to the next requisition.


        -snitchy larry told us the others have been hiding 'something' in the caves. had the boys search the place but came up empty. larry gets no rations for a bad tip.


        -larry was found with his throat slit in his cell. none of the others would spill the beans, no matter how hard we beat them


        -things feel off. its just this gut premonition. the prisoners look at us different, move different, talk and act more reserved. they're up to something but no ammount of searches is producing results, and none are willing to become the new larry, no matter how many rations we offer.


        -were getting our supply shipment with a new change of guards and fresh inmates tomorrow. im going to ask command to rotate some of the ones we have off planet, maybe that will shake them up.
